Example_3:
input: ['.', '.', '.', '.', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', '.', '.', 'e', '.']
output: ['.', '.', '.', '.', '.', '.', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'e', '.']

Test case:
input: ['.', 'g', 'g', 'g', 'g', '.', '.', 'e', '.', '.', '.', '.', '.', '.', '.', '.', '.', '.', '.']

###########################################################
Sample Outputs:
output: ['.', '.', '.', 'g', 'g', '.', '.', 'e', '.', '.', '.', '.', '.', '.', '.', '.', '.', '.', '.']
*/

public class Solution {
    public String[] expand(String S) {
        List<String> res = new ArrayList<>();
        int len = 0;
        while (len < S.length()) {
            char c = S.charAt(len);
            if (c == '.') break;
            int count = 0;
            while (len < S.length() && Character.isDigit(S.charAt(len))) {
                count = count * 10 + (S.charAt(len++) - '0');
            }
            StringBuilder sb = new StringBuilder();
            for (int i = 0; i < count; ++i) {
                sb.append(c);
            }
            res.add(sb.toString());
            len++;
        }
        if (len < S.length()) {
            res.add(".");
            len++;
        }
        while (len < S.length()) {
            res.add(S.substring(len, len + 1));
            len++;
        }
        return res.toArray(new String[res.size()]);
    }
}
